import React, { useState } from 'react';

const MyComponent = () => {
  const [productCreate, setProductCreate] = useState({});
  const [supplierProductList, setSupplierProductList] = useState({ products: [] });
  const [supplierProductListMy, setSupplierProductListMy] = useState({ products: [] });
  const [farmerProductDetails, setFarmerProductDetails] = useState({ product: {} });
  const [farmerReviewCreate, setFarmerReviewCreate] = useState({});
  const [farmerProductUpdate, setFarmerProductUpdate] = useState({ productReviewed: {} });
  const [supplierProductForAllList, setSupplierProductForAllList] = useState({ products: [] });

  // Reducer functions

  const productCreateReducer = (state = {}, action) => {
    switch (action.type) {
      case 'SUPPLIER_PRODUCT_CREATE_REQUEST':
        return { loading: true };
      case 'SUPPLIER_PRODUCT_CREATE_SUCCESS':
        return { loading: false, success: true, product: action.payload };
      case 'SUPPLIER_PRODUCT_CREATE_FAIL':
        return {};
      default:
        return state;
    }
  };

  const supplierProductListReducer = (state = { products: [] }, action) => {
    switch (action.type) {
      case 'SUPPLIER_PRODUCT_LIST_REQUEST':
        return { loading: true };
      case 'SUPPLIER_PRODUCT_LIST_SUCCESS':
        return { loading: false, products: action.payload };
      case 'SUPPLIER_PRODUCT_LIST_FAIL':
        return { loading: false, error: action.payload };
      default:
        return state;
    }
  };

  const supplierProductListMyReducer = (state = { products: [] }, action) => {
    switch (action.type) {
      case 'SUPPLIER_PRODUCT_LIST_MY_REQUEST':
        return { loading: true };
      case 'SUPPLIER_PRODUCT_LIST_MY_SUCCESS':
        return { loading: false, products: action.payload };
      case 'SUPPLIER_PRODUCT_LIST_MY_FAIL':
        return { loading: false, error: action.payload };
      default:
        return state;
    }
  };

  const farmerProductDetailsReducer = (state = { product: {} }, action) => {
    switch (action.type) {
      case 'SUPPLIER_PRODUCT_REQUEST':
        return { loading: true, ...state };
      case 'SUPPLIER_PRODUCT_SUCCESS':
        return { loading: false, product: action.payload };
      case 'SUPPLIER_PRODUCT_FAIL':
        return { loading: false, error: action.payload };
      default:
        return state;
    }
  };

  const farmerReviewCreateReducer = (state = {}, action) => {
    switch (action.type) {
      case 'FARMER_PRODUCT_CREATE_REVIEW_REQUEST':
        return { loading: true };
      case 'FARMER_PRODUCT_CREATE_REVIEW_SUCCESS':
        return { loading: false, success: true };
      case 'FARMER_PRODUCT_CREATE_REVIEW_FAIL':
        return { loading: false, error: action.payload };
      case 'FARMER_PRODUCT_CREATE_REVIEW_RESET':
        return {};
      default:
        return state;
    }
  };

  const farmerProductUpdateReducer = (state = { productReviewed: {} }, action) => {
    switch (action.type) {
      case 'SUPPLIER_PRODUCT_UPDATE_REQUEST':
        return { loading: true };
      case 'SUPPLIER_PRODUCT_UPDATE_SUCCESS':
        return { loading: false, success: true };
      case 'SUPPLIER_PRODUCT_UPDATE_FAIL':
        return { loading: false, error: action.payload };
      case 'SUPPLIER_PRODUCT_UPDATE_RESET':
        return { productReviewed: {} };
      default:
        return state;
    }
  };

  const supplierProductForAllListReducer = (state = { products: [] }, action) => {
    switch (action.type) {
      case 'SUPPLIER_PRODUCT_FOR_ALL_REQUEST':
        return { loading: true };
      case 'SUPPLIER_PRODUCT_FOR_ALL_SUCCESS':
        return { loading: false, products: action.payload };
      case 'SUPPLIER_PRODUCT_FOR_ALL_FAIL':
        return { loading: false, error: action.payload };
      default:
        return state;
    }
  };

  return (
    <div>
      {/* Render your component content here */}
    </div>
  );
};

export default MyComponent;
